import React, {Fragment} from 'react';
import Header from './components/Header';
import Footer from './components/Footer';

function App() {
  return (
    <Fragment>
      <main>
        <Header/>
        </main>
      <h1>Welcome to the shop</h1>
      <Footer/> 
    </Fragment>
  );
}

export default App;
